#include <stdbool.h>
#include <stdlib.h>

int comp(const void* a, const void*b){
  return *(int*)a - *(int*)b;
}

bool isPossibleDivide(int* nums, int numsSize, int k){
  if(numsSize % k != 0){
    return false;
  }
  bool* has_visited = (bool*) calloc(numsSize,sizeof(bool));
  qsort(nums, numsSize, sizeof(int), comp);

  // 开始查找
  while(1){
    // 找第一个没有被访问的元素
    int begin;
    for(begin = 0; has_visited[begin] && begin < numsSize; ++begin){
      ;
    }
    // if(begin == numsSize){ // 如果自然结束循环, 说明所有元素均正常访问
    //   return true;
    // }

    has_visited[begin] = true;
    int count = 1;
    int pre = nums[begin];
    int i;
    for(i=1; begin+i<numsSize && count != k;++i){

      if(nums[begin+i] == pre + 1 && has_visited[begin+i] == false){
        has_visited[begin+i] = true;
        pre = nums[begin+i];
        ++count;
      }
    }
    if(begin+i == numsSize && count == k){
      return true;
    }

    // 上一个循环没有达到跳出条件, 错误
    if(count != k){
      return false;
    }


  }
}


